    public static String compressData(String data) {
        try {
            ByteArrayOutputStream bos = new ByteArrayOutputStream();
//            DeflaterOutputStream zos = new DeflaterOutputStream(bos);
            XZCompressorOutputStream zos = new XZCompressorOutputStream(bos);
            zos.write(data.getBytes());
            zos.close();
            return new String(getenBASE64inCodec(bos.toByteArray()));
        } catch (Exception ex) {
            ex.printStackTrace();
            return "ZIP_ERR";
        }
    }


    public static String getenBASE64inCodec(byte [] b) {
        if (b == null)
            return null;
        return new String((new com.sun.jersey.core.util.Base64()).encode(b));
    }


